&lt;p&gt;&lt;strong&gt;Statements:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;Some roads are streets&lt;/p&gt;

&lt;p&gt;Some streets are lanes&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. No road is a lane&lt;/p&gt;

&lt;p&gt;II. All streets are lanes&lt;/p&gt;
III. Some lanes are roads

